    false,nt"url": null,nt"notes": "This annual narrative report for Missisquoi
    National Wildlife Refuge outlines Refuge accomplishments for the 1978 calendar year.
    The report begins with an introduction to the Refuge and describes climate and habitat
    conditions, and system status. Refuge construction, maintenance, and wildfires are
    also described. Habitat management is covered; croplands, grasslands, wetlands,
    forestlands, and wilderness and special areas are discussed. The wildlife section
    of the report discusses endangered and threatened species, migratory birds, and
    mammals. Interpretation and recreation activities are outlined; topics include information
    and interpretation, recreational uses, and law enforcement. Cooperative programs,
    items of interest, and safety are discussed.",nt"license_title": "License
